import React from 'react';
import Row from './Row.js'

class Map extends React.Component {
  constructor(props) {
    super(props);
    this.map = props.map;
    this.handleClick = props.handleClick;
    this.handleDrop = props.handleDrop;

  }

  render() {
    return (
      <Row map={this.map} row={0} />
    )
  }
}

export default Map
